import React from 'react';
import ReactDOM from 'react-dom';

//
const user = {
	name: 'Jacques Gluke',
	tag: '@jgluke',
	location: 'Ocho Rios, Jamaica',
	avatar: 'https://s3.amazonaws.com/uifaces/faces/twitter/r_oy/128.jpg',
	stats: {
		followers: 5603,
		views: 4827,
		likes: 1308,
	},
};

console.log(user);

ReactDOM.render(user.name, document.querySelector('#root'));
